import React from 'react';
import './style.css';

export default function NotFound() {
    return(
        <div className='container-not-found'>
            <h1>Page not found</h1><br/>
            <img src='https://www.flaticon.com/premium-icon/icons/svg/2645/2645772.svg' alt='Error' />
        </div>
    )
}
